    for order in ('lsb_first','msb_first'):
        # pack bits into bytes: for each group of 8 bits, produce a byte
        out = bytearray()
        if order=='lsb_first':
            # first bit becomes LSB of byte, next becomes next LSB, ...
            for i in range(0, len(bits)//8):
                val = 0
                for j in range(8):
                    val |= (bits[i*8 + j] & 1) << j
                out.append(val)
        else:
            # msb_first: first bit is MSB of output byte
            for i in range(0, len(bits)//8):
                val = 0
                for j in range(8):
                    val = (val<<1) | (bits[i*8 + j] & 1)
                out.append(val)
        s = out.decode('latin1')  # preserve bytes
        # find printable runs
        runs = re.findall(r'[\x20-\x7e]{6,}', s)
        matches=[]
        for r in runs:
            matches += re.findall(r'\{[^}]{1,200}\}', r)
            if re.search(r'flag|ctf|flecks|secret|key', r, flags=re.I):
