import re, sys
fn='flecks'
b = open(fn,'rb').read()
n = len(b)
print("file:", fn, "size:", n)
MAX_MATCHES = 100
found = 0

def find_matches(out_bytes, label):
    global found
    s = out_bytes.decode('latin1')
    runs = re.findall(r'[\x20-\x7e]{8,}', s)  # longer runs to reduce noise
    matches = []
    for r in runs:
        matches += re.findall(r'\{[^}]{1,300}\}', r)
        if re.search(r'flag|ctf|flecks|secret|key|FLAG|CTF', r, flags=re.I):
            matches.append('[KW]'+r[:300])
    if matches:
        print("="*60)
        print(label)
        for m in matches:
            print(m)
            found += 1
            if found >= MAX_MATCHES:
                print("Reached MAX_MATCHES, stopping entire scan.")
                return True
        print("--- sample runs (first 5) ---")
        for rr in runs[:5]:
            print(rr[:300])
    return False

# Try widths 1..6
for width in range(1,7):
    for offset in range(0, 9 - width):  # valid bit offsets 0..(8-width)
        mask = (1 << width) - 1
        # extract field values per byte
        vals = [ (c >> offset) & mask for c in b ]
        # two field bit orders
        for fld_order in ('fld_lsb','fld_msb'):
            # build bitstream from the sequence of field values
            bits = []
            if fld_order == 'fld_lsb':
                for v in vals:
                    for k in range(width):
                        bits.append((v >> k) & 1)
            else:
                for v in vals:
                    for k in range(width-1, -1, -1):
                        bits.append((v >> k) & 1)
            # two output packing orders
            for out_order in ('out_lsb','out_msb'):
                out = bytearray()
                # Only pack whole bytes
                total_bytes = len(bits) // 8
                if total_bytes == 0:
                    continue
                if out_order == 'out_lsb':
                    for i in range(total_bytes):
                        val = 0
                        for j in range(8):
                            val |= (bits[i*8 + j] & 1) << j
                        out.append(val)
                else:
                    for i in range(total_bytes):
                        val = 0
                        for j in range(8):
                            val = (val << 1) | (bits[i*8 + j] & 1)
                        out.append(val)
                label = f"width={width} offset={offset} fld_order={fld_order} out_order={out_order} (produced {len(out)} bytes)"
                stop = find_matches(out, label)
                if stop:
                    break
            if found >= MAX_MATCHES:
                break
        if found >= MAX_MATCHES:
            break
    if found >= MAX_MATCHES:
        break

if found == 0:
    print("No brace-enclosed tokens or keyword hits found for widths 1..6 under tested orders.")
else:
    print(f"Total matches found: {found}.")
