def printable_ratio(b):
    if not b:
        return 0.0
    good = sum(1 for x in b if 32 <= x < 127)
    return good / len(b)

def hexdump(b):
    return ' '.join(f"{x:02x}" for x in b)

def ascii_repr(b):
    return ''.join(chr(x) if 32 <= x < 127 else '.' for x in b)

